import './App.css';
import 'antd/dist/antd.css';
import { Col, Row } from 'antd';

function App() {
  return (
    <div style={{padding: '0px 10px'}}>
      <Row>
        <Col span={24} style={{paddingTop: '30vh'}}></Col>
      </Row>
    </div>
  );
}

export default App;
